using KendoCRUDService.Models;
using KendoCRUDService.SessionExtensions;
using Microsoft.AspNetCore.Mvc;

namespace KendoCRUDService.Controllers
{
    public class EmployeesOrgChartController : Controller
    {
        private readonly ISession _session;

        public EmployeesOrgChartController()
        {
            _session = HttpContext.Session;
        }

        public ActionResult Index()
        {
            var result = from node in AllNodes
                         select new
                         {
                             Id = node.Id,
                             Position = node.Position,
                             FullName = node.FullName,
                             Avatar = node.Avatar,
                             ParentId = node.ParentId,
                         };

            return Json(result);
        }

        public ActionResult LoadOnDemand(int? Id)
        {
            IEnumerable<EmployeeNodeViewModel> result;

            result = AllNodes.Where(e => e.ParentId == Id)
                .Select(e => new EmployeeNodeViewModel
                {
                    Id = e.Id,
                    Position = e.Position,
                    FullName = e.FullName,
                    Avatar = e.Avatar,
                    ParentId = e.ParentId,
                    Expanded = e.Expanded,
                    HasChildren = AllNodes.Where(s => s.ParentId == e.Id).Count() > 0
                });

            return Json(result);
        }

        public JsonResult Create(EmployeeNodeViewModel model)
        {
            int lastID = AllNodes.Select(m => m.Id).Max();
            if (model.Id == 0)
            {
                model.Id = lastID + 1;
            }
            AllNodes.Add(model);

            return Json(model);
        }

        public JsonResult Destroy(EmployeeNodeViewModel model)
        {
            var target = One(m => m.Id == model.Id);
            AllNodes.Remove(target);

            return Json(target);
        }

        public JsonResult Update(EmployeeNodeViewModel model)
        {
            var target = One(m => m.Id == model.Id);

            target.Position = model.Position;
            target.FullName = model.FullName;
            target.ParentId = model.ParentId;
            target.Avatar = model.Avatar;

            return Json(target);
        }


        public EmployeeNodeViewModel One(Func<EmployeeNodeViewModel, bool> predicate)
        {
            return AllNodes.FirstOrDefault(predicate);
        }

        private IList<EmployeeNodeViewModel> AllNodes
        {
            get
            {
                IList<EmployeeNodeViewModel> result = _session.GetObjectFromJson<IList<EmployeeNodeViewModel>>("OrgChartEmployees");

                if (result == null)
                {
                    result = new List<EmployeeNodeViewModel>
                    {
                        new EmployeeNodeViewModel { Id = 1, Expanded = true, Position = "CEO", ParentId = null, FullName = "Michelle Lowrence", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 2, Expanded = false, Position = "Sales and Marketing Manager", ParentId = 1, FullName = "Laura Richardson", Avatar = "data:image/jpeg;base64,"  },
                        new EmployeeNodeViewModel { Id = 3, Expanded = false, Position = "Financial Manager", ParentId = 1, FullName = "Robert Tomson", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 4, Expanded = false, Position = "Sales Team Lead", ParentId = 2, FullName = "Martina Howell", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 5, Expanded = false, Position = "Marketing Specialist", ParentId = 2, FullName = "Steven North", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 6, Expanded = false, Position = "Accountant", ParentId = 3, FullName = "Katrin Donalds", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 7, Expanded = false, Position = "Accountant", ParentId = 3, FullName = "Sean Rusell", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 8, Expanded = false, Position = "Sales Representative", ParentId = 4, FullName = "Nicola Miller", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 9, Expanded = false, Position = "Sales Representative", ParentId = 4, FullName = "Daniel Morisson", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 10, Expanded = false, Position = "Junior Sales Representative", ParentId = 4, FullName = "Pamela Baker", Avatar = "data:image/jpeg;base64," },
                        new EmployeeNodeViewModel { Id = 11, Expanded = false, Position = "Junior Accountant", ParentId = 7, FullName = "Andrew Berry", Avatar = "data:image/jpeg;base64," }
                    };

                    _session.SetObjectAsJson("OrgChartEmployees", result);
                }
                return result;
            }
        }
    }
}
